import React from 'react';
import ReactDOM from 'react-dom';
import './css/bootstrap.css';



class Game extends React.Component {
  render() {


    return (
    	<div class="container">
    		<section id="1">
    			<article class="row-12"><h1>App name</h1></article>
    		</section>
    	</div>

    );
  }
}
ReactDOM.render(
  <MeteoPage />,
  document.getElementById('root')
);
